import React from "react";
import { useNavigate } from "react-router-dom";

function Signup()
{
    let navigate = useNavigate();
    return (
        <div>
        <h1>Signup</h1>
        <button onClick={()=>navigate("/login")}>Login</button>
        <button onClick={()=>navigate("/")}>Home</button>
        </div>
    );
}

export default Signup;
